import React, { useEffect, useState } from "react";
import "./Result.css";

export default function Result({ searchCriteria }) {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    setLoading(true);
    setError(null);

    // 构建查询参数
    const queryParams = new URLSearchParams(searchCriteria).toString();
    const url = queryParams ? 
      `https://api.yourlocalapidomain.com/car?${queryParams}` : 
      `https://api.yourlocalapidomain.com/car`;

    fetch(url)
      .then((response) => {
        if (!response.ok) throw new Error("Failed to fetch data");
        return response.json();
      })
      .then((data) => {
        setCars(data);
        setLoading(false);
      })
      .catch((error) => {
        setError(error.message);
        setLoading(false);
      });
  }, [searchCriteria]);

  return (
    <div className="result-container">
      <h2 className="text-xl font-bold mb-4">Car List</h2>

      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>Error: {error}</p>
      ) : cars.length === 0 ? (
        <p>No Data Found</p>
      ) : (
        <table className="result-table">
          <thead>
            <tr>
              <th>Make</th>
              <th>Model</th>
              <th>Year</th>
              <th>Description</th>
              <th>Odometer (km)</th>
              <th>Vehicle Condition</th>
              <th>Sale Location</th>
              <th>Sale Category</th>
              <th>Salvage Vehicle</th>
              <th>Sale Date</th>
              <th>Sale Price</th>
            </tr>
          </thead>
          <tbody>
            {cars.map((car, index) => (
              <tr key={index}>
                <td>{car.make}</td>
                <td>{car.model}</td>
                <td>{car.year}</td>
                <td>{car.description}</td>
                <td>{car.odometer}</td>
                <td>{car.car_condition}</td>
                <td>{car.states}</td>
                <td>{car.sales_category}</td>
                <td>{car.salvage_vehicle ? "Yes" : "No"}</td>
                <td>{car.sale_date}</td>
                <td>{car.sale_price}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
